import Nbar from './Nbar.js';
import storage from './storage.js'



class App extends Component {

  constructor(props){
    super(props)
    this.state = {
      contract:'',
    }    
  }

  render() {
    return (
      <div className="Home">
        <Nbar/>
      </div>
    );
  }
}

export default App;
